function initTask(subTask) {

   //console.log('initTask', subTask.display)
   $("#map").empty();
   $("#json").empty();

   var state = {};
   var level;
   var answer = null;
   var data = {
      easy: {
         target: {
            bias: 10,
            figures: [
               {"type":"point", "lat": 46.179015,"lng": -1.374416}
            ]
         } 
      },
      medium: {
         target: {
            bias: 10,
            figures: [
               {"type":"point", "lat": 46.179015,"lng": -1.374416},
               {"type":"point", "lat": 46.1975,"lng": -1.432}
            ]
         } 
      },
      hard: {
         target: {
            bias: 10,
            figures: [
               {"type":"line", "points": [
                  {"lat": 46.1785,"lng": -1.375},
                  {"lat": 46.1975,"lng": -1.371},
                  {"lat": 46.1975,"lng": -1.432}
               ]},
               { "type": "line", "points": [  
                  {"lat": 46.2467,"lng": -1.4945},
                  {"lat": 46.2243,"lng": -1.5364}
               ]}
            ]
         } 
      }      
   };

   var imgW = 1200;
   var imgH = 650;
   var mapW = 730;
   var mapH = Math.floor(730*650/1200);
   var firstZoom = Math.log2(mapW/imgW);

   var map2d;
   var editor;
   var target;

   var mapUrl = " data:image/jpeg;base64,";


   var coordinates_map = {
      tl: {
         lat: 46.260584, 
         lng: -1.580404
      },
      br: {
         lat: 46.137215, 
         lng: -1.250496
      },
      testLat: function(lat) {
         return (lat - this.tl.lat) * (lat - this.br.lat) < 0;
      },
      testLng: function(lng) {
         return (lng - this.tl.lng) * (lng - this.br.lng) < 0;
      },      
      convertPoint: function(point) {
         return {
            x: imgW * ((point.lng - this.tl.lng) / (this.br.lng - this.tl.lng)),
            y: imgH * ((point.lat - this.tl.lat) / (this.br.lat - this.tl.lat))
         }
      },
      convertFigures: function(figures) {
         var res = [];
         for(var i=0; i<figures.length; i++) {
            if(figures[i].type == 'point') {
               var item = this.convertPoint(figures[i]);
            } else {
               var item = {
                  points: []
               }
               for(var j=0; j<figures[i].points.length; j++) {
                  item.points.push(
                     this.convertPoint(figures[i].points[j])
                  )
               }
            }
            item.type = figures[i].type;
            res.push(item);
         }
         return res;
      }
   }

   
   subTask.loadLevel = function(curLevel) {
      //console.log('subTask.loadLevel', curLevel)
      displayHelper.avatarType = "none";
      level = curLevel;
      target = {
         figures: coordinates_map.convertFigures(data[level].target.figures),
         bias: data[level].target.bias
      }
   };

   subTask.getStateObject = function() {
      //console.log('subTask.getStateObject')
      return state;
   };



   subTask.resetDisplay = function() {
      //console.log('resetDisplay');
      displayError("");
      initEditor();
      initMap2d(function() {
         displayHelper.customValidate = checkResult;
      });
   };

   subTask.getDefaultAnswerObject = function() {
      //console.log('getDefaultAnswerObject');
      var defaultAnswer = { 
         json: '[]'
      };      
      return defaultAnswer;
   };

   subTask.getAnswerObject = function() {
      //console.log('subTask.getAnswerObject', answer);
      return answer;
   };

   subTask.reloadAnswerObject = function(answerObj) {
      //console.log('subTask.reloadAnswerObject', answerObj)
      answer = answerObj;
      if(!answer) {
         return;
      }
      editor && editor.setContent(answer.data);
   };

   subTask.unloadLevel = function(callback) {
      //console.log('subTask.unloadLevel');      
      map2d && map2d.destroy();
      editor && editor.destroy();
      callback();
   };

   subTask.getGrade = function(callback) {
      checkResult(true, function(res) {
         //console.log('subTask.getGrade', res)
         callback(res)
      });      
   };

   function testProps(obj, expected_props) {
      var missed_props = [];
      for(var i=0; i<expected_props.length; i++) {
         if(!(expected_props[i] in obj)) {
            missed_props.push(expected_props[i]);
         }
      }
      if(missed_props.length) {
         return displayError(taskStrings.missed_props + missed_props.join(', '));
      }

      var obj_props = Object.keys(obj);
      var extra_props = [];
      for(var i=0; i<obj_props.length; i++) {
         if(expected_props.indexOf(obj_props[i]) === -1) {
            extra_props.push(obj_props[i]);
         }
      }      
      if(extra_props.length) {
         return displayError(taskStrings.extra_props + extra_props.join(', '));
      }
      return true;      
   }


   function testPoint(point) {
      if(!coordinates_map.testLat(point.lat)) {
         return displayError(taskStrings.invalid_lat + point.lat);
      }
      if(!coordinates_map.testLng(point.lng)) {
         return displayError(taskStrings.invalid_lng + point.lng);
      }
      return true;      
   }


   function validateFigureData(item) {
      if(typeof(item) !== 'object' || item === null) {
         return displayError(taskStrings.invalid_data);
      }
      if(!('type' in item)) {
         return displayError(taskStrings.missed_props + 'type');   
      }
      if(item.type == 'point') {
         if(!testProps(item, ['type', 'lat', 'lng'])) {
            return false;
         }
         if(!testPoint(item)) {
            return false;
         }
      } else if(item.type == 'line' || item.type == 'area') {
         if(!testProps(item, ['type', 'points'])) {
            return false;
         }
         if(!Array.isArray(item.points)) {
            return displayError(taskStrings.not_array + 'points');               
         }
         if(!item.points.length) {
            return displayError(taskStrings.points_empty);               
         }
         for(var i=0; i<item.points.length; i++) {
            if(!testProps(item.points[i], ['lat', 'lng'])) {
               return false;
            }
            if(!testPoint(item.points[i])) {
               return false;
            }            
         }
      } else {
         return displayError(taskStrings.invalid_type + item.type);   
      }
      return item;
   }


   function validateFiguresData(data) {
      var res = [];
      if(!Array.isArray(data)) {
         return displayError(taskStrings.invalid_data);   
      }
      for(var i=0; i<data.length; i++) {
         var item = validateFigureData(data[i]);
         if(item) {
            res.push(item);
         }
      }
      return coordinates_map.convertFigures(res);
   }

   function onEditorChange(content) {
      answer = {
         json: content
      }                           
      refreshMap();
   }


   function refreshMap() {
      var figures = [];
      try { 
         var data = JSON.parse(answer.json);
         figures = validateFiguresData(data);
      } catch(e) {}
      map2d.setFigures(figures); 
   }

   function initEditor() {
      if(!editor) {
         editor = JSONTextEditor({
            parent: document.getElementById('json'),
            onChange: onEditorChange
         });                     
      }
      editor.setContent(answer.json);
   }

   function initMap2d(callback) {
      function onLoad() {
         refreshMap();
         callback && callback();
      }
      if(map2d) {
         return onLoad();
      } 
      map2d = Map2D({
         parent: document.getElementById('map'),
         url: mapUrl,
         zoom: firstZoom,
         height: mapH,
         width: mapW,
         simple_mode: true,
         onLoad: onLoad
      });
   };

   function displayError(msg) {
      //console.log('displayError', msg);
      if(msg == ""){
         $("#error").hide();
      }else{
         $("#error").show();
         $("#errorMsg").html(msg);
      }
   };

   function formatSyntaxErrorMsg(metadata) {
      if(metadata.expected.length) {	
         return taskStrings.expecting + metadata.expected.join(',');	
      } else {	
         return taskStrings.invalid_json;	
      }      
   }

   function checkResult(noVisual, callback) {
      //console.log('checkResult',noVisual)
      initEditor();
      initMap2d(function() {
         var syntax_error = editor.getSyntaxError(noVisual);
         if(syntax_error) {
            var msg = formatSyntaxErrorMsg(syntax_error);
            if(!noVisual){
               displayError(msg);
            }
            callback && callback({ 
               successRate: 0, 
               message: msg
            });
            return;            
         }

         var valid = map2d.diff(target, noVisual);
         if(!valid){
            if(!noVisual){
               displayError(taskStrings.fail);
            }
            callback && callback({ 
               successRate: 0, 
               message: taskStrings.fail
            });
            return;
         }
         if(!noVisual){
            platform.validate("done");
         }
         callback && callback({ 
            successRate: 1, 
            message: taskStrings.success 
         });
         return;
      });
   };

}
initWrapper(initTask, ["easy", "medium", "hard"]);
displayHelper.useFullWidth();